import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu) using text selector
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Click the mobile menu trigger (simulate mobile menu open)
    await page.click('.nav-menu');
    // Wait for the overlay to appear using ID selector and class
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of mobile menu open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Find and click a navigation link inside the mobile menu (e.g., "Electronics")
    // Use XPath to find the first visible "Electronics" link inside the overlay
    const electronicsLink = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//a[contains(text(),"Electronics")]',
      { timeout: 5000 }
    );
    await electronicsLink.click();

    // Wait for the main content to update (category or products grid)
    // Use a selector that appears after navigation, e.g., a heading or grid
    await page.waitForSelector('h2', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_electronics.png'));

    // Re-open mobile menu to test close
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Click the close button inside the mobile menu (use button with class and text)
    const closeBtn = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//button[contains(@class,"close-mobile-menu")]',
      { timeout: 5000 }
    );
    await closeBtn.click();

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay', { state: 'hidden', timeout: 5000 });

    // Take screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Extract data: Check if main content shows Electronics category/products
    const heading = await page.$eval('h2', el => el.textContent.trim());
    const electronicsCards = await page.$$eval('.product-card', cards =>
      cards.filter(card => card.textContent.toLowerCase().includes('electronics')).length
    );

    return {
      success: true,
      action: "Tested mobile menu open, navigation to 'Electronics', and close. Verified content update.",
      extractedData: {
        heading,
        electronicsProductCards: electronicsCards
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
